import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Navbar from './components/Navbar';
import HomePage from './components/HomePage';
import DistrictCourtPage from './components/DistrictCourt';
import HighCourtPage from './components/HighCourt';
import SupremeCourtPage from './components/SupremeCourt';
import StateSelection from './components/StateSelection';

function App() {
  return (
    <Router>
      <Navbar />
      <Routes>
        <Route path="/" element={<HomePage />} />
        {/* StateSelection for District Courts */}
        <Route path="/district" element={<StateSelection courtType="district" />} />
        {/* StateSelection for High Courts */}
        <Route path="/high" element={<StateSelection courtType="high" />} />

        {/* Dynamic routes for individual states and their respective court types */}
        <Route path="/district/:state" element={<DistrictCourtPage />} />
        <Route path="/high/:state" element={<HighCourtPage />} />

        <Route path="/supreme" element={<SupremeCourtPage />} />
      </Routes>
    </Router>
  );
}

export default App;
